import { Nav, Navbar, Container } from "react-bootstrap";
import "../../Assets/NavBar.css";

const NavBar = (props) => {
  return (
    <React.Fragment>
      <Navbar bg="primary" variant="dark">
        <Container>
          <Navbar.Brand>{props.header}</Navbar.Brand>
          <Nav className="me-auto"></Nav>
        </Container>
      </Navbar>
      <Navbar bg="primary" variant="dark">
        <Container>
          <Navbar.Brand>{props.header}</Navbar.Brand>
          <Nav className="me-auto"></Nav>
        </Container>
      </Navbar>
    </React.Fragment>
  );
};

export default NavBar;
